function canvasJournal() {
  /**
   * demo.js
   * http://www.codrops.com
   *
   * Licensed under the MIT license.
   * http://www.opensource.org/licenses/mit-license.php
   * 
   * Copyright 2018, Codrops
   * http://www.codrops.com
   */

  const mapNumber = (X, A, B, C, D) => (X - A) * (D - C) / (B - A) + C;
  // from http://www.quirksmode.org/js/events_properties.html#position
  const getMousePos = (e) => {
    let posx = 0;
    let posy = 0;
    if (!e) e = window.event;
    if (e.pageX || e.pageY) {
      posx = e.pageX;
      posy = e.pageY;
    } else if (e.clientX || e.clientY) {
      posx = e.clientX + document.body.scrollLeft + document.documentElement.scrollLeft;
      posy = e.clientY + document.body.scrollTop + document.documentElement.scrollTop;
    }
    return {
      x: posx,
      y: posy
    }
  }
  // Generate a random float.
  const getRandomFloat = (min, max) => (Math.random() * (max - min) + min).toFixed(2);

  /**
   * One class per effect. 
   * Lots of code is repeated, so that single effects can be easily used. 
   */


  // Effect 3
  class HoverImgFx3 {
    constructor(el) {
      this.DOM = {
        el: el
      };
      this.DOM.reveal = document.createElement('div');
      this.DOM.reveal.className = 'hover-reveal';
      this.DOM.reveal.style.overflow = 'hidden';
      this.DOM.reveal.innerHTML = `<div class="hover-reveal__inner"><div class="hover-reveal__img" style="background-image:url(${this.DOM.el.dataset.img})"></div></div>`;
      this.DOM.el.appendChild(this.DOM.reveal);
      this.DOM.revealInner = this.DOM.reveal.querySelector('.hover-reveal__inner');
      this.DOM.revealInner.style.overflow = 'hidden';
      this.DOM.revealImg = this.DOM.revealInner.querySelector('.hover-reveal__img');
      //charming(this.DOM.el);
      this.DOM.letters = [...this.DOM.el.querySelectorAll('span')];
      this.initEvents();

    }
    initEvents() {

      this.positionElement = (ev) => {
        const mousePos = getMousePos(ev);
        const docScrolls = {
          left: document.body.scrollLeft + document.documentElement.scrollLeft,
          //top : document.body.scrollTop + document.documentElement.scrollTop
          top: document.body.querySelector('.journal-list').parentNode.offsetTop - document.body.querySelector('.journal-list').getBoundingClientRect().top
        };
        //console.log(document.body.querySelector('.journal-list').parentNode.offsetTop)
        this.DOM.reveal.style.top = `${mousePos.y+docScrolls.top}px`;
        //this.DOM.reveal.style.left = `${mousePos.x+docScrolls.left}px`;
        //this.DOM.reveal.style.left = `-50px`;
        this.DOM.reveal.style.left = `${((0) + (mousePos.x/2))-10+docScrolls.left}px`;
      };
      this.mouseenterFn = (ev) => {
        this.positionElement(ev);
        this.showImage();

      };
      this.mousemoveFn = ev => requestAnimationFrame(() => {
        this.positionElement(ev);
      });
      this.mouseleaveFn = () => {
        this.hideImage();
      };

      this.DOM.el.addEventListener('mouseenter', this.mouseenterFn);
      this.DOM.el.addEventListener('mousemove', this.mousemoveFn);
      this.DOM.el.addEventListener('mouseleave', this.mouseleaveFn);
    }
    showImage() {
      TweenMax.killTweensOf(this.DOM.revealInner);
      TweenMax.killTweensOf(this.DOM.revealImg);

      this.tl = new TimelineMax({
          onStart: () => {
            this.DOM.reveal.style.opacity = 1;
            TweenMax.set(this.DOM.el, {
              zIndex: 1000
            });
          }
        })
        .add('begin')
        .set([this.DOM.revealInner, this.DOM.revealImg], {
          transformOrigin: '50% 100%'
        })
        .add(new TweenMax(this.DOM.revealInner, 0.8, {
          ease: Expo.easeOut,
          startAt: {
            x: '0%',
            y: '0%',
            scale: .8,
            opacity: 0
          },
          x: '0%',
          y: '0%',
          scale: 1,
          opacity: 1
        }), 'begin')
        .add(new TweenMax(this.DOM.revealImg, 0.8, {
          ease: Expo.easeOut,
          startAt: {
            x: '0%',
            y: '0%',
            scale: .8,
            opacity: 0
          },
          x: '0%',
          y: '0%',
          scale: 1,
          opacity: .9
        }), 'begin')
        .add(new TweenMax(this.DOM.revealImg, 1.5, {
          ease: Expo.easeOut,
          startAt: {
            scale: 1.5
          },
          scale: 1,
          opacity: .9
        }), 'begin');
    }
    hideImage() {
      TweenMax.killTweensOf(this.DOM.revealInner);
      TweenMax.killTweensOf(this.DOM.revealImg);

      this.tl = new TimelineMax({
          onStart: () => {
            TweenMax.set(this.DOM.el, {
              zIndex: 999
            });
          },
          onComplete: () => {
            TweenMax.set(this.DOM.el, {
              zIndex: ''
            });
            TweenMax.set(this.DOM.reveal, {
              opacity: 0
            });
          }
        })
        .add('begin')
        .add(new TweenMax(this.DOM.revealInner, 1, {
          ease: Expo.easeOut,
          y: '-120%',
          rotation: 0,
          opacity: 0
        }), 'begin')
        .add(new TweenMax(this.DOM.revealImg, 1, {
          ease: Expo.easeOut,
          y: '120%',
          rotation: 0,
          scale: .5,
          opacity: 0
        }), 'begin')
    }

  }


  [...document.querySelectorAll('[data-fx="3"] > .journal-thumbnail-container')].forEach(link => new HoverImgFx3(link));


}


