// ---- CUSTOM CURSOR ---- //

(function () {
  Math.clamp = function (a, b, c) {
    return Math.max(b, Math.min(c, a));
  }
})();

function qCursor() {

  var w = window;
  const b = document.getElementsByTagName("body")[0];
  b.addEventListener("mousemove", mouseMove);
  var cursor = document.getElementById('cursor');
  var cursor2 = document.getElementById('cursor2');


  cursorUnhover();

  function mouseMove(e) {
    // Custom Cursor
    cursor.style.left = e.clientX + 'px';
    cursor.style.top = e.clientY + 'px';
    cursor2.style.left = e.clientX + 'px';
    cursor2.style.top = e.clientY + 'px';
  }

  function cursorHover(e) {
    cursor2.classList.add("hover");
  }

  function cursorUnhover(e) {
    cursor2.classList.remove("hover");
  }

  function cursorDrag(e) {
    cursor2.classList.add("drag");
    cursor.classList.add("drag");
  }

  function cursorUndrag(e) {
    cursor2.classList.remove("drag");
    cursor.classList.remove("drag");
  }


  var hovers = document.querySelectorAll(".hover-target");
  var drags = document.querySelectorAll(".drag-target");

  for (var i = hovers.length - 1; i >= 0; i--) {
    var hover = hovers[i];
    hoverHandler(hover);
  };

  if (drags) {
    for (var i = drags.length - 1; i >= 0; i--) {
      var drag = drags[i];
      dragHandler(drag);
    };
  }


  function hoverHandler(hover) {
    hover.addEventListener("mouseover", cursorHover);
    hover.addEventListener("mouseout", cursorUnhover);
  }

  function dragHandler(drag) {
    drag.addEventListener("mouseover", cursorDrag);
    drag.addEventListener("mouseout", cursorUndrag);
  }

};


