// Q ANIMATE

function q_animate(element, animation, delay) {

  if (animation === 'stagTop') {
    TweenMax.staggerFromTo(
      element, 1, {
        alpha: 0,
        y: 130
      }, {
        alpha: 1,
        y: 0,
        ease: Expo.easeOut,
        delay: delay
      }, 0.15
    );
  }

  if (animation === 'fadeOut') {
    TweenMax.to(
      element, .3, {
        alpha: 0,
        ease: Power1.easeOut,
        delay: delay
      }, 0.15
    );
  }


  if (animation === 'slideTop') {
    TweenMax.fromTo(
      element, 1.5, {
        alpha: 0,
        y: 50
      }, {
        alpha: 1,
        y: 0,
        ease: Expo.easeOut,
        delay: delay
      }
    );
  }


  if (animation === 'slideLeft') {
    TweenMax.fromTo(
      element, 1.5, {
        alpha: 0,
        xPercent: -100
      }, {
        alpha: 1,
        xPercent: 0,
        ease: Expo.easeOut,
        delay: delay
      }
    );
  } else if (animation === 'sideLeft') {
    TweenMax.staggerFromTo(
      element, 1.5, {
        alpha: 0,
        x: 120
      }, {
        alpha: 1,
        x: 0,
        ease: Expo.easeOut,
        delay: delay
      }, 0.2
    );
  } else if (animation === 'clientLeft') {
    TweenMax.staggerFromTo(
      element, 1.5, {
        alpha: 0,
        x: 180
      }, {
        alpha: .6,
        x: 0,
        ease: Expo.easeOut,
        delay: delay
      }, 0.05
    );
  } else if (animation === 'sideRight') {
    TweenMax.staggerFromTo(
      element, 1.5, {
        alpha: 0,
        x: -120
      }, {
        alpha: 1,
        x: 0,
        ease: Expo.easeOut,
        delay: delay
      }, 0.2
    );
  } else if (animation === 'clipRight') {
    TweenMax.staggerTo(
      element, 1, {
        clipPath: 'inset(0px 0px 0px 0px)',
        ease: Expo.easeInOut,
        delay: delay
      }, 0.1
    );
  }

  if (animation === 'stagLeft') {

    TweenMax.staggerFromTo(
      element, 1, {
        alpha: 0,
        x: 50
      }, {
        alpha: 1,
        x: 0,
        ease: Expo.easeOut,
        delay: delay
      }, 0.1
    );
  }

  if (animation === 'stagRight') {
    TweenMax.staggerFromTo(
      element, 1, {
        alpha: 0,
        x: -50
      }, {
        alpha: 1,
        x: 0,
        ease: Expo.easeOut,
        delay: delay
      }, 0.1
    );
  }

  if (animation === 'fadeLeft') {

    TweenMax.staggerFromTo(
      element, .6, {
        alpha: 1,
        x: 0
      }, {
        alpha: 0,
        x: -50,
        ease: Expo.easeIn,
        delay: 0
      }, 0.05
    );
  }

  if (animation === 'fadeRight') {

    TweenMax.staggerFromTo(
      element, .6, {
        alpha: 1,
        x: 0
      }, {
        alpha: 0,
        x: 50,
        ease: Expo.easeIn,
        delay: 0
      }, 0.05
    );
  } else if (animation === 'splitLeft') {

    var content = element.textContent;
    var letters = content.split("");
    element.innerHTML = "";

    for (var idx = 0; idx < letters.length; idx++) {
      element.innerHTML += "<span>" + letters[idx] + "</span>";
    }

    var chars = element.querySelectorAll('span');

    TweenMax.set(chars, {
      x: 80,
      alpha: 0
    });

    setTimeout(function () {
      TweenMax.staggerTo(
        chars, 1.3, {
          x: 0,
          alpha: 1,
          ease: Expo.easeOut
        }, 0.035
      );
    }, 700);

  } else if (animation === 'splitRight') {

    var content = element.textContent;
    var letters = content.split("");
    element.innerHTML = "";

    for (var idx = 0; idx < letters.length; idx++) {
      element.innerHTML += "<span>" + letters[idx] + "</span>";
    }

    var chars = element.querySelectorAll('span');

    TweenMax.set(chars, {
      x: -80,
      alpha: 0
    });

    setTimeout(function () {
      TweenMax.staggerTo(
        chars, 1.3, {
          x: 0,
          alpha: 1,
          ease: Expo.easeOut
        }, -0.035
      );
    }, delay);

  }

};


// split text animation

function animateText() {
  var lettr = document.getElementById("lettr");
  var lines = lettr.querySelectorAll('font');
  for (var x = lines.length - 1; x >= 0; x--) {
    var line = lines[x];
    lineHandler(line);
  };

  function lineHandler(line) {
    var text = line.textContent;
    var wordSplit = text.split("");
    line.innerHTML = "";
    for (w = 0; w < wordSplit.length; w++) {
      line.innerHTML += "<span>" + wordSplit[w] + "</span>";
    }
    chars = line.querySelectorAll('span');
    for (var x = chars.length - 1; x >= 0; x--) {
      var char = chars[x];
      charHandler(char, x);
    };

    function charHandler(char, x) {
      char.style.transitionDelay = x * .1 + "s";
    }
  }
}
