function smoothScroll() {

  if (scroll) {
    scroll.destroy();
  }
  scroll = new LocomotiveScroll({
    el: document.querySelector('[data-scroll-container]'),
    smooth: true,
    lerp: .075,
    offset: [-300, -300]
  });

  const reveal_items = document.querySelectorAll('.reveal');

  reveal_items.forEach((rev, i) => {
    rev.classList.add('reveal__on')
  });

  scroll.on("scroll", function (t, e) {
    hideShowHeader(t)
  })

  scroll.on('call', function (value, way, obj) {
    if (value == 'revMask') {
      const reveal_masks = obj.el.querySelectorAll('.text_cover');

      if (reveal_masks && obj.el.classList.contains('is-inview')) {
        TweenMax.staggerTo(reveal_masks, .5, {
          webkitMaskSize: "cover",
          webkitMaskImage: "linear-gradient(170deg, rgb(0, 0, 0) ".concat(20, "%, rgba(255, 255, 255, 0) ").concat(100, "%)"),
          ease: Power2.easeIn,
          delay: 0,
          onComplete: continueAnim
        }, .1)

        function continueAnim() {
          TweenMax.to(reveal_masks, 2, {
            webkitMaskImage: "linear-gradient(170deg, rgb(0, 0, 0) ".concat(100, "%, rgba(255, 255, 255, 0) ").concat(100, "%)"),
            ease: Power2.easeOut
          });
        }

      }
    }
  });


}
